import React from 'react';
import logo from './logo.svg';
import './App.css';
import { store } from './Actions/Store'
import { Provider } from 'react-redux'
import Usuario from './Components/Usuario'

function App() {
  return (
    <Provider store={ store }>
      <Usuarios />
    </Provider>
  );
}

export default App;
